import { Routes, Route } from 'react-router-dom';
import Login from './components/Login';
import Users from './components/Users';

const App = () => {
  return (
    <div>
      <Routes>
        <Route exact path="/" component={Login} />
        <Route path="/users" component={Users} />
      </Routes>
    </div>
  );
};

export default App;
